<html>
  <head>
    <title>SVG Collision Test - Michael K. Pellegrino</title>
    <script language="javascript">
      
      /* this array contains all of the elements in the SVG window */
      var things=[];
      var direction=0;
      var isCollision=0;

      /* allow the bigger circle to be moved by arrow key presses */
      document.addEventListener('keydown', Kdown);
      document.addEventListener('keyup', Kup);
      function Kup(e)
      {
	  isCollision=0;
	  direction = 0;
      }
      
      function Kdown(e)
      {
	  var elm = document.getElementById("btn");
	  var x=elm.getAttribute('cx');
	  var y=elm.getAttribute('cy');
	  
	  var K=e.keyCode;
	  if( K == 38||K==73 )
	  {
	      /* up */
	      direction=1;
	  }
	  else if( K == 37||K==74)
	  {
	      /* left */
	      direction = 4;

	  }
	  else if( K == 40||K==75 )
	  {
	      /* down */
	      direction =2;
	  }
	  else if( K == 39||K==76)
	  {
	      /* right */
	      direction=3;
	  }
      }

      /* When the page loads, put all of the 
	 svg elements that have an id that 
	 matches oc15.25, oc15.30, oc15.35, etc...
	 is put into the 'things' array.
	 
	 the ocXX.YY is intended to be used as the
	 coordinates of the svg element. */
      function onload()
      {
	  var k=0;
	  var elm;
	  var duplicate=0;
	  for(  i=0; i<2500; i++ )
	  {
	      x="wall." + i;
	      elm=document.getElementById(x);
	      if( elm != null )
		  things[k++] = elm;
	  }
	  start_time = new Date();
	  setInterval(update_position,5)
      }

      function update_position()
      {
	  if( direction == 0 ) return;
	  var elm = document.getElementById("btn");
	  var x=elm.getAttribute('cx');
	  var y=elm.getAttribute('cy');
	  if( direction == 1 )
	  {
	      if( willCollide( x, (1)*(y)-1 ) ) return;
	      elm.setAttribute('cy', (1)*(y)-1 ); return;
	  }
	  else if( direction == 2 )
	  {
	      if( willCollide( x, (1)*(y)+1 ) ) return;
	      elm.setAttribute('cy', (1)*(y)+1 ); return;
	  }
	  else if( direction == 3 )
	  {
	      if( willCollide( (1)*(x)+1, y ) ) return;
	      elm.setAttribute('cx', (1)*(x)+1 );return;
	  }
	  else if( direction == 4 )
	  {
	      if( willCollide( (1)*(x)-1, y ) ) return;
	      elm.setAttribute('cx', (1)*(x)-1 );return;
	  }
	  
      }
      
      function winner()
      {
	  var s1 = document.getElementById("btn");
	  var x=1*s1.getAttribute('cx');	  
	  var y=1*s1.getAttribute('cy');
	  if( x > 1230 && y > 1230 )
	      return 1;
	  return 0;
      }
      
      /* Check for a collision between btn and
	 any element in the 'things' array */
      function willCollide( s1x, s1y )
      {
	  var s2;
	  
	  for(  i=0; i<things.length; i++ )
	  {
	      s2=things[i];
	      var s2x1= 1*s2.getAttribute('x1');
	      var s2x2= 1*s2.getAttribute('x2');
	      var s2y1= 1*s2.getAttribute('y1');
	      var s2y2= 1*s2.getAttribute('y2');

	      var TLx;
	      var TLy;
	      var BRx;
	      var BRy;
	
	      /* create the bounding box */
	      /* TL: Top Left Corner */
	      /* BR: Bottom Right Corner */
	      if(s2x1==s2x2)
	      {
		  TLx=1*s2x1-4;
		  BRx=1*s2x2+4
	      }
	      else if( s2x1<s2x2 )
	      {
		  TLx=s2x1;
		  BRx=s2x2;
	      }
	      else 
	      {
		  TLx=s2x2;
		  BRx=s2x1;
	      }

	      if(s2y1==s2y2)
	      {
		  TLy=1*s2y1-4;
		  BRy=1*s2y2+4;
	      }
	      else if( s2y1<s2y2 )
	      {
		  TLy=s2y1;
		  BRy=s2y2;
	      }
	      else
	      {
		  TLy=s2y2;
		  BRy=s2y1;
	      }

	      
	      if( (s1x <= BRx) && (s1x >= TLx) && (s1y <= BRy ) && (s1y >= TLy) )
	      {
		  return 1;
	      }
	  }
	  return 0;
	  

      }
      
    </script>
